// frontend/src/pages/employee/Dashboard.jsx
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './EmployeeDashboard.css';

const EmployeeDashboard = () => {
  const [stats, setStats] = useState({
    availableGames: 8,
    activeRentals: 3,
    completedToday: 5,
    canceledToday: 1
  });

  const [myActiveRentals, setMyActiveRentals] = useState([
    { id: 1, customer: 'ÿ£ÿ≠ŸÖÿØ ŸÖÿ≠ŸÖÿØ', game: 'ÿØÿ±ŸäŸÅÿ™ ŸÉÿßÿ±', startTime: '14:30', endTime: '15:00', timeLeft: '15 ÿØŸÇŸäŸÇÿ©' },
    { id: 2, customer: 'ÿ≥ÿßÿ±ÿ© ÿÆÿßŸÑÿØ', game: 'ŸáÿßŸÅÿ± ÿ®Ÿàÿ±ÿØ', startTime: '14:45', endTime: '15:15', timeLeft: '25 ÿØŸÇŸäŸÇÿ©' },
    { id: 3, customer: 'ŸÖÿ≠ŸÖÿØ ÿπŸÑŸä', game: 'ÿ≥ŸÉŸàÿ™ÿ± ŸÉŸáÿ±ÿ®ÿßÿ¶Ÿä', startTime: '15:00', endTime: '15:30', timeLeft: '35 ÿØŸÇŸäŸÇÿ©' },
  ]);

  const [availableGames, setAvailableGames] = useState([
    { id: 1, name: 'ÿØÿ±ŸäŸÅÿ™ ŸÉÿßÿ±', price: 120, status: 'ŸÖÿ™ÿßÿ≠' },
    { id: 2, name: 'ŸáÿßŸÅÿ± ÿ®Ÿàÿ±ÿØ', price: 60, status: 'ŸÖÿ™ÿßÿ≠' },
    { id: 3, name: 'ŸÖŸàÿ™ÿ≥ŸÉŸÑ ŸÉŸáÿ±ÿ®ÿßÿ¶Ÿä', price: 100, status: 'ŸÖÿ™ÿßÿ≠' },
    { id: 4, name: 'ÿπÿ±ÿ®ŸäŸá ŸÉŸáÿ±ÿ®ÿßÿ¶ŸäŸá', price: 150, status: 'ŸÖÿ™ÿßÿ≠' },
    { id: 5, name: 'ÿ≥ŸÉŸàÿ™ÿ± ŸÉŸáÿ±ÿ®ÿßÿ¶Ÿä', price: 50, status: 'ŸÖÿ™ÿßÿ≠' },
    { id: 6, name: 'Ÿáÿßÿ±ŸÑŸä', price: 180, status: 'ŸÖÿ™ÿßÿ≠' },
    { id: 7, name: 'ÿ≥Ÿäÿ¨ŸàÿßŸä', price: 70, status: 'ŸÖÿ™ÿßÿ≠' },
    { id: 8, name: 'ŸÉÿ±Ÿäÿ≤Ÿä ŸÉÿßÿ±', price: 130, status: 'ŸÖÿ™ÿßÿ≠' },
  ]);

  // ŸÖÿ≠ÿßŸÉÿßÿ© ÿßŸÑÿπÿØ ÿßŸÑÿ™ŸÜÿßÿ≤ŸÑŸä
  useEffect(() => {
    const interval = setInterval(() => {
      setMyActiveRentals(prev => 
        prev.map(rental => {
          const timeLeft = parseInt(rental.timeLeft);
          if (timeLeft > 0) {
            return { ...rental, timeLeft: `${timeLeft - 1} ÿØŸÇŸäŸÇÿ©` };
          }
          return rental;
        })
      );
    }, 60000); // ŸÉŸÑ ÿØŸÇŸäŸÇÿ©

    return () => clearInterval(interval);
  }, []);

  const handleCompleteRental = (id) => {
    setMyActiveRentals(prev => prev.filter(rental => rental.id !== id));
    setStats(prev => ({
      ...prev,
      activeRentals: prev.activeRentals - 1,
      completedToday: prev.completedToday + 1
    }));
  };

  const handleCancelRental = (id) => {
    setMyActiveRentals(prev => prev.filter(rental => rental.id !== id));
    setStats(prev => ({
      ...prev,
      activeRentals: prev.activeRentals - 1,
      canceledToday: prev.canceledToday + 1
    }));
  };

  return (
    <div className="employee-dashboard">
      <div className="dashboard-header">
        <h1>ŸÑŸàÿ≠ÿ© ÿßŸÑŸÖŸàÿ∏ŸÅ</h1>
        <p>ŸÖÿ±ÿ≠ÿ®ÿßŸã ÿ®ŸÉ ŸÅŸä ŸÜÿ∏ÿßŸÖ ÿ™ÿ£ÿ¨Ÿäÿ± ÿßŸÑÿ£ŸÑÿπÿßÿ®</p>
      </div>

      {/* ÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™ ÿ≥ÿ±Ÿäÿπÿ© */}
      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon">üéÆ</div>
          <div className="stat-content">
            <h3>ÿßŸÑÿ£ŸÑÿπÿßÿ® ÿßŸÑŸÖÿ™ÿßÿ≠ÿ©</h3>
            <h2>{stats.availableGames}</h2>
            <p>ŸÑÿπÿ®ÿ© ÿ¨ÿßŸáÿ≤ÿ© ŸÑŸÑÿ™ÿ£ÿ¨Ÿäÿ±</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">‚è±Ô∏è</div>
          <div className="stat-content">
            <h3>ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ±ÿßÿ™ ÿßŸÑŸÜÿ¥ÿ∑ÿ©</h3>
            <h2>{stats.activeRentals}</h2>
            <p>ÿ™ÿ£ÿ¨Ÿäÿ± ŸÇŸäÿØ ÿßŸÑÿ™ÿ¥ÿ∫ŸäŸÑ</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">‚úÖ</div>
          <div className="stat-content">
            <h3>ÿßŸÑŸÖŸÉÿ™ŸÖŸÑÿ© ÿßŸÑŸäŸàŸÖ</h3>
            <h2>{stats.completedToday}</h2>
            <p>ÿ™ÿ£ÿ¨Ÿäÿ± ŸÖŸÉÿ™ŸÖŸÑ</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">‚ùå</div>
          <div className="stat-content">
            <h3>ÿßŸÑŸÖŸÑÿ∫ÿßÿ© ÿßŸÑŸäŸàŸÖ</h3>
            <h2>{stats.canceledToday}</h2>
            <p>ÿ™ÿ£ÿ¨Ÿäÿ± ŸÖŸÑÿ∫Ÿä</p>
          </div>
        </div>
      </div>

      {/* ÿ®ÿØÿ° ÿ™ÿ£ÿ¨Ÿäÿ± ÿ¨ÿØŸäÿØ */}
      <div className="new-rental-section">
        <div className="section-header">
          <h2>ÿ®ÿØÿ° ÿ™ÿ£ÿ¨Ÿäÿ± ÿ¨ÿØŸäÿØ</h2>
          <Link to="/rental" className="btn-primary">
            ÿ®ÿØÿ° ÿ™ÿ£ÿ¨Ÿäÿ± ÿ¨ÿØŸäÿØ
          </Link>
        </div>
        
        <div className="available-games">
          <h3>ÿßŸÑÿ£ŸÑÿπÿßÿ® ÿßŸÑŸÖÿ™ÿßÿ≠ÿ©</h3>
          <div className="games-grid">
            {availableGames.map(game => (
              <div key={game.id} className="game-card">
                <div className="game-image">
                  <img 
                    src={`/images/${game.name.replace(/\s+/g, '-').toLowerCase()}.jpg`}
                    alt={game.name}
                    onError={(e) => {
                      e.target.onerror = null;
  e.target.src = "/frontend/public/images/";

}}
                  />
                </div>
                <div className="game-info">
                  <h4>{game.name}</h4>
                  <p className="game-price">{game.price} ÿ±ŸäÿßŸÑ/ÿ≥ÿßÿπÿ©</p>
                  <span className={`game-status ${game.status === 'ŸÖÿ™ÿßÿ≠' ? 'available' : 'busy'}`}>
                    {game.status}
                  </span>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ±ÿßÿ™ ÿßŸÑŸÜÿ¥ÿ∑ÿ© */}
      <div className="active-rentals-section">
        <div className="section-header">
          <h2>ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ±ÿßÿ™ ÿßŸÑŸÜÿ¥ÿ∑ÿ©</h2>
          <Link to="/employee/rentals" className="btn-secondary">
            ÿπÿ±ÿ∂ ÿ¨ŸÖŸäÿπ ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ±ÿßÿ™
          </Link>
        </div>

        {myActiveRentals.length === 0 ? (
          <div className="empty-state">
            <p>ŸÑÿß ÿ™Ÿàÿ¨ÿØ ÿ™ÿ£ÿ¨Ÿäÿ±ÿßÿ™ ŸÜÿ¥ÿ∑ÿ© ÿ≠ÿßŸÑŸäÿßŸã</p>
          </div>
        ) : (
          <div className="rentals-grid">
            {myActiveRentals.map(rental => (
              <div key={rental.id} className="rental-card">
                <div className="rental-header">
                  <h3>{rental.customer}</h3>
                  <span className="rental-timer">{rental.timeLeft}</span>
                </div>
                
                <div className="rental-info">
                  <div className="info-row">
                    <span className="label">ÿßŸÑŸÑÿπÿ®ÿ©:</span>
                    <span className="value">{rental.game}</span>
                  </div>
                  <div className="info-row">
                    <span className="label">ŸàŸÇÿ™ ÿßŸÑÿ®ÿØÿ°:</span>
                    <span className="value">{rental.startTime}</span>
                  </div>
                  <div className="info-row">
                    <span className="label">ŸàŸÇÿ™ ÿßŸÑÿßŸÜÿ™Ÿáÿßÿ°:</span>
                    <span className="value">{rental.endTime}</span>
                  </div>
                </div>

                <div className="rental-actions">
                  <button 
                    className="btn-extend"
                    onClick={() => alert(`ÿ™ŸÖ ÿ™ŸÖÿØŸäÿØ ÿ™ÿ£ÿ¨Ÿäÿ± ${rental.customer} 15 ÿØŸÇŸäŸÇÿ©`)}
                  >
                    ÿ™ŸÖÿØŸäÿØ 15 ÿØŸÇŸäŸÇÿ©
                  </button>
                  <button 
                    className="btn-complete"
                    onClick={() => handleCompleteRental(rental.id)}
                  >
                    ÿ•ŸÜŸáÿßÿ°
                  </button>
                  <button 
                    className="btn-cancel"
                    onClick={() => handleCancelRental(rental.id)}
                  >
                    ÿ•ŸÑÿ∫ÿßÿ°
                  </button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>

      {/* ÿ™ÿπŸÑŸäŸÖÿßÿ™ ÿ≥ÿ±Ÿäÿπÿ© */}
      <div className="quick-guide">
