          <div className="guide-item">
            <div className="guide-icon">1</div>
            <div className="guide-content">
              <h4>ÿßÿÆÿ™ÿ± ŸÑÿπÿ®ÿ©</h4>
              <p>ÿßÿÆÿ™ÿ± ÿßŸÑŸÑÿπÿ®ÿ© ÿßŸÑŸÖŸÜÿßÿ≥ÿ®ÿ© ŸÑŸÑÿπŸÖŸäŸÑ ŸÖŸÜ ŸÇÿßÿ¶ŸÖÿ© ÿßŸÑÿ£ŸÑÿπÿßÿ® ÿßŸÑŸÖÿ™ÿßÿ≠ÿ©</p>
            </div>
          </div>
          <div className="guide-item">
            <div className="guide-icon">2</div>
            <div className="guide-content">
              <h4>ÿ£ÿØÿÆŸÑ ÿ®ŸäÿßŸÜÿßÿ™ ÿßŸÑÿπŸÖŸäŸÑ</h4>
              <p>ÿ≥ÿ¨ŸÑ ÿßÿ≥ŸÖ ÿßŸÑÿπŸÖŸäŸÑ Ÿàÿ±ŸÇŸÖ ÿßŸÑŸáÿßÿ™ŸÅ Ÿàÿ™ÿ≠ÿØŸäÿØ ÿßŸÑŸÖÿØÿ©</p>
            </div>
          </div>
          <div className="guide-item">
            <div className="guide-icon">3</div>
            <div className="guide-content">
              <h4>ÿßÿ®ÿØÿ£ ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ±</h4>
              <p>ÿßÿ∂ÿ∫ÿ∑ ÿπŸÑŸâ ÿ≤ÿ± ÿßŸÑÿ®ÿØÿ° Ÿàÿ≥Ÿäÿ™ŸÖ ÿ®ÿØÿ° ÿßŸÑÿπÿØ ÿßŸÑÿ™ŸÜÿßÿ≤ŸÑŸä ÿ™ŸÑŸÇÿßÿ¶ŸäÿßŸã</p>
            </div>
          </div>
          <div className="guide-item">
            <div className="guide-icon">4</div>
            <div className="guide-content">
              <h4>ÿßŸÑŸÖÿ™ÿßÿ®ÿπÿ©</h4>
              <p>ÿ™ÿßÿ®ÿπ ÿßŸÑŸàŸÇÿ™ ÿßŸÑŸÖÿ™ÿ®ŸÇŸä Ÿàÿ≠ÿ≥ÿ® ÿßŸÜÿ™Ÿáÿßÿ° ÿßŸÑŸàŸÇÿ™ ÿ£Ÿà ÿ∑ŸÑÿ® ÿßŸÑÿ™ŸÖÿØŸäÿØ</p>
            </div>
